snippet.description:
Shmup Arena is a fast and frantic shooter arena where you need to survive several waves of enemies and some powerful bosses;
Coming soon on Steam;
Shmup Arena é um arena shooter rápido e frenético, onde você precisa sobreviver a diversas ondas de inimigos e alguns chefes poderosos;
Steam Game: https://store.steampowered.com/app/1205540/Shmup_Arena/
Twitter: https://twitter.com/RevoxGames

